Бөлімнің негізгі мақсаттары мен міндеттері:
         - Шағымдар мен өтініштердің жұмыс;
         - Әрбір клиент үшін бірінші класты қызмет ету;
         - Әлсіз жақтарын анықтауға, зерттеу «жасырын сатып алушы» жүргізу;
         - Қызмет көрсету сапасын жақсарту бойынша күнделікті жұмыс;
